import React from "react";
import classes from "Albums.module.css";

const Albums = (props) => {
  return (
    <div id="music-content">
      <div id="music-content" className={classes["div"]}>
        <h3 id="music-content" className={classes.h3}>
          {props.title}
        </h3>
        <div className={classes["image-container"]}>
          <img
            className={classes["prod-images"]}
            src={props.imageUrl}
            alt="album images"
          />
        </div>
        <div id="music-content" className={classes["prod-details"]}>
          <span>{props.price}</span>
          <button id="music-content" className={classes["shop-item-button"]}>
            ADD TO CART
          </button>
        </div>
      </div>
    </div>
  );
};

export default Albums;
